import React from 'react'

function Joke(props) {
    if (props.question) {
        return (
            <div>
                <div className="question">{props.question}</div>
                <div className="punchline">{props.punchline}</div>
            </div>
        )
    } else {
        return (
            <div className="punchline">{props.punchline}</div>
        )
    }
}

export default Joke
